import React from 'react';
import Welcome from '../component/pages/welcome'
import {UserProvider} from '../component/user';

function App() {

  const user = { name: 'Tania', loggedIn: true ? "heri"  : "sadf" }

  return (
    <UserProvider value={user}>
        <div className="App">
        <h1>welcome to react app</h1>
        <Welcome />
      </div>
    </UserProvider>
  );
}

export default App;
